import * as setBookHeader from './PariState';
import * as setBookCover from './PariState';

import * as signIn from './LoginReducer';
import * as signOut from './LoginReducer';

export default {
  //PariState
  ...setBookHeader,
  ...setBookCover,

  //LoginReducer
  ...signIn,
  ...signOut,
};
